import PropTypes from 'prop-types'


function Header({ text, bgColor, textColor }) {

    const headerStyles = {
        backgroundColor:bgColor, 
        color: textColor

    }
    return (
        <header style={headerStyles}>
            <div className="container"></div>
            <h2>{text}</h2>
        </header>
    )
}

Header.defaultProps = {
    text: 'Feedback UI',
}

Header.propTypes = {
    test: PropTypes.string,
}

export default Header
